subproject.description:
	Stock Take of three Conventions; 
	Thematic Profiles and priority issues; 
	In depth analyses/assessment on cross cutting issues; 
	Preparation of a NAP to address capacity constraints and needs with regard to the strategic implementation of the Rio Conventions;

	Building necessary capacity to address POP related issues, including baseline inventories and assessment of national capacity to address POPs;
	Increasing public awareness about POPs’ human and environmental effects;
	Formulating a National Implementation Plan for meeting country obligations under the Convention
